const createCache = options => {
  const cache = {
    get(key) {
      const sessionStorageValue = sessionStorage.getItem([options.prefix, key].join('/'));
      return sessionStorageValue ? JSON.parse(sessionStorageValue) : null;
    },
    set(key, value) {
      try {
        sessionStorage.setItem([options.prefix, key].join('/'), JSON.stringify(value));
        return true;
      } catch (_error) {
        return false;
      }
    },
    unset(key) {
      sessionStorage.removeItem([options.prefix, key].join('/'));
    }
  };
  return cache;
};

const version = "13.1.7";

export { createCache as default, version };
